def convertSalary(salary):
    if salary == "不限":
        return '#','#'
    elif salary == "2k以下":
        return '#','2'
    elif salary == '2k-3k':
        return '2','3'
    elif salary == '3k-4k':
        return '3','4'
    elif salary == '5k-8k':
        return '5','8'
    elif salary == '8k-12k':
        return '8','12'
    elif salary == '12k-20k':
        return '12','20'
    else:
        return '20','#'


def statisticalQuantity(queryResult):
    res=queryResult['hits']['hits']
    dicts={}
    for item in res:
        newDict = dict(item)
        if newDict["_source"]['JobTypeName'] not in dicts:
            dicts[newDict["_source"]['JobTypeName']]=[item]
        else:
            dicts[newDict["_source"]['JobTypeName']].append(item)
    # print(newDict["_source"])
    for key, val in dicts.items():
        dicts[key].append({'count': len(val)})
    dicts = sorted(dicts.items(), key=lambda value: value[1][-1]['count'], reverse=True)

    jobTypeList = []
    for json in dicts:
        value = json[1][0]
        dic = dict()
        jobType = value['_source']['JobType']
        jobTypeName = value['_source']['JobTypeName']
        dic["jobType"] = jobType
        dic['jobTypeLabel'] = jobTypeName
        count = json[1][-1]['count']
        dic['jobNum'] = count
        jobTypeList.append(dic)
    # TODO 后续改为 前20
    return jobTypeList[:20]


def regionExpansion(para):
    if para in area:
        res = []
        for key,value in zone[area[para]].items():
            res.append(value)
        return res


